Na osnovu jednog od ovih razloga, optuženi treba da izloži relevantne činjenice i priloži dokaze kojima se opravdava odbacivanje optužnice.

Na primer, prema članu 244, st. 1, tačka 1.7 KZK: Smatram da je optužnica u suprotnosti sa zakonom, podsećajući da je Rešenjem PPr.Kr.nr.______ od ______ Osnovnog suda u _____ ODBIJENA MOLBA tužilaštva za izdavanje konač
